import { Routes, Route } from 'react-router-dom';
import Auth from './components/comps/Auth/Auth';
import Account from './components/comps/Account';
import Asses from './components/comps/Asses';
import Likes from './components/comps/Likes/Likes';
import { useNavigate } from 'react-router-dom';

function App() {


  return (
    <div className="App">
      <Routes>
        <Route
          path={"/Auth"}
          element={<Auth />}
        />
        <Route
          path={"/Account"}
          element={<Account></Account>}
        />
        <Route
          path={"/Asses"}
          element={<Asses></Asses>}
        />
        <Route
          path={"/Likes"}
          element={<Likes></Likes>}
        />
        <Route
          path={"*"}
          element={<Auth />}
        />
      </Routes>
    </div>
  );
}

export default App;
